def react(x: str) -> str:
    """
    Runs a reaction until no more reactions are possible, which will result in the same string or a shorter one
    """
    i = 0
    next_trigger = None

    while i < len(x):
        c = x[i]
        if c == next_trigger:
            x = f'{x[:i-1]}{x[i+1:]}'
            # backtrack for new trigger
            i = max(i-2, 0)
            next_trigger = None
            continue
        if c.isupper():
            next_trigger = c.lower()
        else:
            next_trigger = c.upper()
        i += 1

    return x


def part1(x: str) -> int:
    return len(react(x))


def part2(x: str) -> int:
    return min(
        len(react(y))
        for y in [x.replace(z, '').replace(z.upper(), '') for z in set(x.lower())]
    )


puzzle_input = ''

if __name__ == '__main__':
    print(part1(puzzle_input))
    print(part2(puzzle_input))
